//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAVLINK_DATA_STREAM_TYPE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAVLINK_DATA_STREAM_TYPE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAVLINK_DATA_STREAM_IMG_JPEG.MarshalText()
		require.NoError(t, err)

		var dec MAVLINK_DATA_STREAM_TYPE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAVLINK_DATA_STREAM_IMG_JPEG, dec)
	})
}
